  false,\n\t\"url\": null,\n\t\"notes\": \"During the spring of 2000, the Vermont
  Institute of Natural Science (VINS) conducted its first breeding landbird survey
  at the Putney Mountain Unit (Tract 15) of the Silvio O. Conte National Fish and
  Wildlife Refuge (Hunt and Lambert 2000). In 2001 a second survey was conducted.
  Like the first, its purpose was to document the occurrence, distribution and relative
  abundance of landbird species. Survey data will contribute to a baseline for future
  monitoring and will guide development of management goals. The Conte Refuge provided
  funding support for this investigation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
